import React from "react";
import axios from "axios";

export default function Video() {
  return (
    <div className="YoutubeVideoPlayer">
      <iframe
        id="player"
        type="text/html"
        width="640"
        height="390"
        src="http://www.youtube.com/embed/M7lc1UVf-VE?enablejsapi=1&origin=http://example.com"
        frameborder="0"
      ></iframe>
    </div>
  );
}
